}

const listGroup = $('#alerts .list-group');
const handleAlerts = (data) => {
    const alerts = data.results.payload.DATA.filter((alert) => {
        if (!alert.snoozed_date) return true
        return +new Date() > +new Date(alert.snoozed_date)
    })
    listGroup.empty();

    if (alerts.length === 0) {
        listGroup.append('No active alerts')
    } else {
        alerts.forEach((a) => {
            const item = $('<button class="alert-item list-group-item list-group-item-action"></button>')
            const itemDesc = $('<span></span>');
            const alertType = getAlertConfig(a.configuration_id)
            itemDesc.html(`
            <div class="message">
                <span><i class="warning fa fa-exclamation-triangle" aria-hidden="true"></i></span>
                ${alertType.message || ''}</div>
            <div class="text-muted">${AlertConfigSummary(alertType) || ''}</div>
            `)
            const itemTime = $('<span></span>');
            itemTime.css({
                'font-size': '.75rem'
            })
            let time = a.sent_date;
            try {
                time = new Date(time).toLocaleString()
            } catch (e) {
                console.warn('Unable to parse time', e);
            }
            const itemButtons = `<div class="alert-buttons">
            <button class="btn btn-outline-warning btn-sm alert-action-btn snooze-alert d-float" data-snoozed-count=${a.snoozed_count} data-item-id=${a.item_id}>Snooze</button>
            <button class="alert-action-btn btn btn-outline-success btn-sm acknowledge-alert" data-item-id=${a.item_id}>Acknowledge</button>
        </div>`
            item.append(itemButtons);

            item.append(itemDesc);
            item.append(`<div>${time}</div>`);
            listGroup.append(item);
        })
    }
}

if (!window.hasSubscribedToAlerts) {
